import { Container, FacebookIcon, InstagramIcon, SocialContainer, WhatsappIcon } from "./styles";

function Footer(){
    return(
        <Container>
            <SocialContainer>
                <FacebookIcon></FacebookIcon>
                <InstagramIcon></InstagramIcon>
                <WhatsappIcon></WhatsappIcon>
            </SocialContainer>
        </Container>
    )
}

export default Footer;
